import './App.css';
import { Content, Row, Col } from './modules/Grid'
import { Card } from './modules/Card'

const title = document.getElementsByTagName('title');
title.innerHTML = 'Compendium de Criaturas';

function App() {
  return (
    <div>
      <div style={{height: 20}}></div>

      <Content container='container'>
        <Row>
          <Col col='col-md-4'>
            <Card />
          </Col>
          <Col col='col-md-4'>
            <Card />
          </Col>
          <Col col='col-md-4'>
            <Card />
          </Col>
        </Row>
      </Content>
    </div>
  );
}

export default App;
